import React, { useState } from 'react';
import { Routes, Route } from 'react-router-dom';
import Step1CSV from './Step1CSV';
import Step2Images from './Step2Images';
import Step3Review from './Step3Review';


export default function MultiUpload() {
const [csvRows, setCsvRows] = useState([]);
const [csvFileName, setCsvFileName] = useState('');
const [matches, setMatches] = useState({});
const [unmatched, setUnmatched] = useState([]);
const [zipName, setZipName] = useState('');


return (
<Routes>
<Route path="step1" element={<Step1CSV setCsvRows={setCsvRows} setCsvFileName={setCsvFileName} />} />
<Route path="step2" element={<Step2Images csvRows={csvRows} setMatches={setMatches} setUnmatched={setUnmatched} setZipName={setZipName} />} />
<Route path="step3" element={<Step3Review csvRows={csvRows} matches={matches} unmatched={unmatched} zipName={zipName} />} />
</Routes>
);
}
